import React from "react";

const estilos={
table:{
    heigth:"100%",
    border:"2px solid black",
},
th:{ border:"2px solid black"}
}



export const Tabla=()=>{

    return(
      <div> 
        <table style={estilos.table}>
            <tr>
            <th>Muertes</th>
            <th>Poblacion</th>
            <th>Diferencia</th>
            </tr>

        </table>
      </div>
    )
}
